import React from "react";
import Item from "./Item.js"

function MainContent(){

    const num = [1,2,3,4,5];
    const arr = num.map(function(n){
        return <Item num = {n} />
    })

    return(
        <div className="card">
            {arr}
        </div>
    );
}

export default MainContent;
